import React from 'react';
import { Link } from 'react-router-dom'; // Предполагается использование React Router для навигации

function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <Link to="/login">Вход</Link>
          </li>
          <li>
            <Link to="/register">Регистрация</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
